	<script>
		function ajaxPagination(pageId) {
			const params = new URLSearchParams(window.location.search);
			var categorySlug = '';
			var q = '';

			// گرفتن categorySlug و q از URL
			if (params.has('categorySlug')) {
				categorySlug = params.get(""categorySlug"");
			}
			if (params.has('q')) {
				q = params.get(""q"");
			}

			// ارسال درخواست Ajax به URL جدید
			$.ajax({
				url: `/search/Pagination?pageId=${pageId}&q=${q}&categorySlug=${categorySlug}`, // اضافه کردن categorySlug به URL
				type: ""get"",
				beforeSend: function () {
					$("".loading"").show();
				},
				complete: function () {
					$("".loading"").hide();
				}
			}).done(function (data) {
				$(""#ajaxSearch"").html(data);

				
			});
		}


	</script>
");
